using namespace std;

class Solution {
public:
    bool isTransformable(string s, string t) {
        if( s == t ) return true;
        auto n = s.size();
        if( n == 1 && s != t ) return false;

        int li[10]; // lowest index for 0,1,...,9
        for(char k = '0'; k <= '9'; ++k) {
            auto pos = s.find(k,0);
            li[k-'0'] = pos != string::npos ? pos : 100000;
        }

        // for(int k : li) cout << k << " ";
        // cout << endl;
        // return false;

        bool r = true;
        // int i = 0; // idx in source string
        for(auto j = 0; j < n; ++j) { // idx in target string
            // cout << "pos i in source " << i << endl;
            // cout << "source " << s << endl;
            // for(int k : li) cout << k << " ";
            // cout << endl;
            // cout << "pos j in target         " << j << endl;

            char neu = t[j]; // char in t that char in s needs to match or be changed into
            // cout << "char at pos j in target " << neu << endl;
            // look up lowest index of neu in s
            int posOfNeuInSource = li[neu-'0'];
            if( j == posOfNeuInSource ) {
                // match
                // update lowest position of neu in s
                auto pos = s.find(neu,posOfNeuInSource+1);
                li[neu-'0'] = pos != string::npos ? pos : 100000;
                // ++i;
            } else {
                // check that was is currently at that pos
                // if( neu > old ) return false; // cannot bring a larger number forward via sort

                // update lowest index for the char we matched
                auto pos = s.find(neu,posOfNeuInSource+1);
                li[neu-'0'] = pos != string::npos ? pos : 100000;


                // int mn = 100000;
                for(char k = '0'; k <= '9'; ++k) {
                    if( li[k-'0'] < posOfNeuInSource ) {
                        if( k < neu && posOfNeuInSource != 100000 ) {

                            // cout << "pos j in target         " << j << endl;
                            // cout << "char at pos j in target " << neu << endl;
                            // for(int x : li) cout << x << " ";
                            // cout << endl;
                            // cout << "posOfNeuInSource        " << posOfNeuInSource << endl;
                            // cout << "k " << k << endl;

                            return false; // we cannot bring a larger number forward via sort

                        }
                        ++li[k-'0'];
                    }
                    // mn = min(mn,li[k-'0']);
                }
                // i = mn;


                // s.erase(s.begin() + posOfNeuInSource);
            }
        }

        // cout << "after sorts" << endl;
        // cout << "s " << s << endl;

        return r;
    }
};

